import React from "react";
import CircularProgress from "./CircularProgress";

const CalcPercent = (props) => {
    return (
        <CircularProgress
            size={250}
            strokeWidth={10}
            percentage={props.percent}
            color="green"
        />
    );
}

export default CalcPercent
